import React from "react";
import Header from "../components/Header";
import Footer from "../components/Footer";
import './Author.css'

const Author = () => {
  return(
    <div className="Author">
      <Header />
      <div className="title">
      <h2>북적거래</h2>
      </div>
      <div className="box"></div>
      <Footer />
    </div>
  )
}

export default Author;
